import{
  createBrowserRouter,
  RouterProvider,
}from"react-router-dom";

import Home from"./pages/Home/Home";
import Product from"./pages/Product/Home";
import Products from"./pages/Home/Home";


const router=createBrowserRouter([
  {
    path:"/",
    element:<Home/>

  },
  {
    path:"/products/:id",
    element:<Products/>

  },
  {
    path:"/product/:id",
    element:<Product/>

  },

])

function App() {
  return (
    <div>
      <RouterProvider router={router}/>
    </div>
  );
}

export default App;
